import React, { useState } from 'react';

const Slider = () => {
  const images = [
    'https://via.placeholder.com/800x400/ff0000/ffffff',
    'https://via.placeholder.com/800x400/00ff00/ffffff',
    'https://via.placeholder.com/800x400/0000ff/ffffff',
  ];

  const [currentImageIndex, setCurrentImageIndex] = useState(0);

  const goToPreviousSlide = () => {
    const index = (currentImageIndex - 1 + images.length) % images.length;
    setCurrentImageIndex(index);
  };

  const goToNextSlide = () => {
    const index = (currentImageIndex + 1) % images.length;
    setCurrentImageIndex(index);
  };

  return (
    <div className="slider">
      <button onClick={goToPreviousSlide}>Previous</button>
      <img src={images[currentImageIndex]} alt={`Slide ${currentImageIndex}`} />
      <button onClick={goToNextSlide}>Next</button>
    </div>
  );
};

export default Slider;
